import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Nutrition", amount: 560.56, date: new Date(16, 12, 22) },
    { title: "Kira", amount: 560.56, date: new Date(16, 12, 22) },
    { title: "Faturalar", amount: 560.56, date: new Date(16, 12, 22) },
    { title: "Yatirim", amount: 560.56, date: new Date(16, 12, 22) },
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  return (
    <div>
      <h2>How you do anything is how you do anything!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        data={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        data={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        data={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        data={expenses[3].date}
      ></ExpenseItem>
      <p>We are finally ready to dive in React LFG</p>
      <button>Hey, I am button</button>
    </div>
  );
}

export default App;
